Berbasis Alam. Proses penjurian rencananya digelar secara virtual atau daring pada tanggal 6-7 Juli 2021.\",\"images\":\"http:\\/\\/localhost\\/storage\\/photos\\/shares\\/prestasi.svg\",\"section\":\"prestasi\",\"link\":\"-\",\"created_at\":\"2023-01-16 15:52:09\",\"updated_at\":\"2023-01-16 15:52:09\"}}',NULL,'2023-01-16 15:52:09','2023-01-16 15:52:09'),(70,'Konten','Konten has been created',NULL,NULL,NULL,1,'Uasoft\\Badaso\\Models\\User','{\"attributes\":{\"id\":9,\"title\":\"Profile\",\"caption\":\"Konon pada zaman dahulu terdapat hamparan hutan rimba, yang dihuni beberapa rumah tangga dengan kehidupan berladang\\/bertani secara berpindah-pindah dan beternak sapi suatu saat masyarakat tersebut menemukan sekelompok orang di Pomahan\\/Bedengan sejumlah 11 orang terdiri dari 2 orang laki-laki dan 9 orang perempuan adapun 2 orang laki-laki tersebut adalah bernama Ki Malangyudho dan seorang cantriknya sedangkan 9 orang perempuan tersebut adalah Nyai Malang Yudho dengan 8 dayang-dayangnya, berdasarkan informasi dari para pinisepuh berasal dari Kraton Tembayat Klaten Jawa Tengah.\\n<br\\/><br\\/>\\nSuatu saat Ki Malang Yudho ngangklang bawono melihat perumahan para anak muridnya kearah Timur sampai di persil 17 d I beliau melihat api sebesar pohon kelapa seolah-olah seperti sampai setinggi langit, lantas beliau bersabda kalau ada ramainya jaman tempat ini dinamakan Genilangit\\n<br\\/><br\\/>\\nSelama bermasyarakat Ki Malang Yudho oleh anggota masyarakat dipercaya sebagai pemimpin desa tersebut, suatu ketika Ki Malang Yudho dengan di ikuti Cantriknya serta anggota masyarakat setempat sudah bermusyawarah berpikir karena pada lokasi yang ditempati tidak ada air, akhir rombongan tersebut berangkat menuju ke Lokasi Trojiwo tidak pernah ditinggalkannya yaitu sebuah teken selalu dibawa kemanapun pergi, disitulah Ki Malang Yudho memperlihatkan kesaktiannya yaitu sebuah teken yang tidak pernah lepas dari tangannya itu diseret yang akhirnya menjadi saluran yang dinamakan Saluran Trojiwo, sebelum airnya mengalir saluran tersebut pernah mengalir jendel\\/lintah melihat kesaktiannya Ki Malang Yudho dijadikan guru karena nasehatnya sangat mengandung arti yang cukup dalam tentang sejatining urip sangat dikenal orang yang lembah manah tapi tidak takut menghadapi bahaya apapun serta tanggung jawab penuh terhadap anak buahnya.\\n<br\\/><br\\/>\\nBeliau sangat tidak senang kepada anak muridnya yang mempunyai sifat takabur\\/sombong, dan juga tidak senang kepada orang yang mempunyai sifat warok, sampai keluar kata-kata barang siapa hidup di desa Genilangit memperlihatkan waroknya pasti tidak akan lama pendek kata tidak krasan akan minggat dari desa ini.\\n<br\\/><br\\/>\\nSambil duduk santai dengan dikerumuni oleh pengikutnya Ki Malang Yudho setiap pembicaraan yang keluar atau didengar selalu mengandung makna, pada saat itu para pengikutnya mendengar He bocah-bocah kabeh mbesuk sak pungkurku ono tlatah kene tak tinggali kunir sak krenjang motoero dan beliau berpesan : 1. Ki Malang Yudho beserta Cantriknya kalau kelak meninggal dunia minta disemayamkan di perbatasan desa Genilangit sebelah Timur, dengan maksud apabila ada mara bahaya dari Timur beliau yang akan menanggulangi. 2. Nyai Malang Yudho yang akrab disebut mbah Putih karena kulitnya putih dengan rambut yang keseluruhan juga putih berserta para dayang-dayangnya sejumlah 8 (delapan) orang, juga minta mohon kelak kalau sudah meninggal dunia mohon untuk disemayamkan di perbatasan desa Genilangit sebelah barat dengan maksud apabila ada mara bahaya dari Barat beliaulah yang akan menahan. 3. Setelah saya meninggal dunia orang yang memimpin kalian namakan LURAH pilihlah orang yang mampu dan mau serta mulat sariro hangroso wani.\",\"images\":\"http:\\/\\/localhost\\/storage\\/photos\\/shares\\/profile2.png\",\"section\":\"profile\",\"link\":\"-\",\"created_at\":\"2023-01-16 16:42:15\",\"updated_at\":\"2023-01-16 16:42:15\"}}',NULL,'2023-01-16 16:42:15','2023-01-16 16:42:15'),(71,'Konten','Konten has been created',NULL,NULL,NULL,1,'Uasoft\\Badaso\\Models\\User','{\"attributes\":{\"id\":10,\"title\":\"VIsi Content\",\"caption\":\"\\u201cTERWUJUDNYA MASYARAKAT DESA GENILANGIT SEJAHTERA YANG BERMARTABAT DAN MANDIRI \\u201d\",\"images\":\"http:\\/\\/localhost\\/storage\\/photos\\/shares\\/logo (1).png\",\"section\":\"visi&misi\",\"link\":\"-\",\"created_at\":\"2023-01-16 16:44:43\",\"updated_at\":\"2023-01-16 16:44:43\"}}',NULL,'2023-01-16 16:44:44','2023-01-16 16:44:44'),(72,'Konten','Konten has been created',NULL,NULL,NULL,1,'Uasoft\\Badaso\\Models\\User','{\"attributes\":{\"id\":11,\"title\":\"Misi Content\",\"caption\":\"-\",\"images\":\"http:\\/\\/localhost\\/storage\\/photos\\/shares\\/logo (1).png\",\"section\":\"visi&misi\",\"link\":\"-\",\"created_at\":\"2023-01-16 16:45:09\",\"updated_at\":\"2023-01-16 16:45:09\"}}',NULL,'2023-01-16 16:45:09','2023-01-16 16:45:09'),(73,'Galeri','Galeri has been created',NULL,NULL,NULL,1,'Uasoft\\Badaso\\Models\\User','{\"attributes\":{\"id\":1,\"title\":\"gallery1\",\"caption\":\"Seluruh warga Dusun Wonomulyo, atas kehadiran Gubernur  Jawa timur Ibu Khofifah beserta Bupati Magetan Bapak Suprawoto dan seluruh rombongan. Wonomulyo sebuah Dusun yang terpencil dan berada di ujung Barat Provinsi Jawa Timur, ternyata sangat diperhatikan Beliau-Beliau. Sungguh kami sangat berterima kasih pada Ibu Gubernur, Bapak Bupati, dan seluruh rombongan yang hadir.\",\"images\":\"http:\\/\\/localhost\\/storage\\/photos\\/shares\\/Screenshot 2023-01-16 at 23.47.02.png\",\"videos\":\"-\",\"type\":\"foto\",\"created_at\":\"2023-01-16 16:52:50\",\"updated_at\":\"2023-01-16 16:52:50\"}}',NULL,'2023-01-16 16:52:50','2023-01-16 16:52:50'),(74,'Galeri','Galeri has been created',NULL,NULL,NULL,1,'Uasoft\\Badaso\\Models\\User','{\"attributes\":{\"id\":2,\"title\":\"galery2\",\"caption\":\"\\u201cTongkling Pringgowulung Wonomulyo\\u201d<br\\/>\\nTongkling merupakan musik tradisional ciri khas Dusun Wonomulyo yang sejarah terbentuknya karena terinspira