INSERT INTO `content` VALUES (1,'Desa Genilangit','Dusun Wonomulyo, Kecamatan Poncol, Kabupaten Magetan, Jawa Timur','http://localhost/storage/photos/shares/imagebg (2).png','top-banner','-','2023-01-16 15:42:51','2023-01-16 15:42:51'),(2,'Profile Desa','Sejarah Desa Genilangit','http://localhost/storage/photos/shares/logo (1).png','feature','http://localhost/profile','2023-01-16 15:44:22','2023-01-16 15:44:22'),(3,'Pemerintahan Desa','Struktur Organisasi dan Tata Kerja Pemerintah Desa Genilangit','http://localhost/storage/photos/shares/logo (1).png','feature','http://localhost','2023-01-16 15:45:29','2023-01-16 15:45:29'),(4,'Visi & Misi','Visi & Misi Pemerintah Desa Genilangit','http://localhost/storage/photos/shares/logo (1).png','feature','http://localhost/visimisi','2023-01-16 15:46:32','2023-01-16 15:46:32'),(5,'Demografi','Data Agama, Pekerjaan & Jenis Kelamin Desa Genilangit','http://localhost/storage/photos/shares/logo (1).png','feature','http://localhost/demografi','2023-01-16 15:49:06','2023-01-16 15:49:06'),(6,'Galeri','Dokumentasi Galeri Desa Genilangit','http://localhost/storage/photos/shares/logo (1).png','feature','http://localhost/galery','2023-01-16 15:50:25','2023-01-16 15:50:25'),(7,'Kelembagaan','BPD, LPMD, RT RW, PKK, Linmas, Karang Taruna, BUMDes Bulakan Sejahtera','http://localhost/storage/photos/shares/logo (1).png','feature','http://localhost/kelembagaan','2023-01-16 15:51:19','2023-01-16 15:51:19'),(8,'Prestasi Kami','Desa Genilangit di Kecamatan Poncol, Kabupaten Magetan, Jawa Timur, berhasil menjadi finalis pada ajang Desa Wisata Awards 2021 yang digelar Kementerian Pariwisata dan Ekonomi Kreatif (Kemenparekraf) bersama BCA.\n<br/>\nBerdasarkan pernyataan yang dikeluarkan Pemkab Magetan melalui laman resmi pemda setempat, Desa Wisata Genilangit masuk dalam kategori Desa Wisata Berbasis Alam. Proses penjurian rencananya digelar secara virtual atau daring pada tanggal 6-7 Juli 2021.','http://localhost/storage/photos/shares/prestasi.svg','prestasi','-','2023-01-16 15:52:09','2023-01-16 15:52:09'),(9,'Profile','Konon pada zaman dahulu terdapat hamparan hutan rimba, yang dihuni beberapa rumah tangga dengan kehidupan berladang/bertani secara berpindah-pindah dan beternak sapi suatu saat masyarakat tersebut menemukan sekelompok orang di Pomahan/Bedengan sejumlah 11 orang terdiri dari 2 orang laki-laki dan 9 orang perempuan adapun 2 orang laki-laki tersebut adalah bernama Ki Malangyudho dan seorang cantriknya sedangkan 9 orang perempuan tersebut adalah Nyai Malang Yudho dengan 8 dayang-dayangnya, berdasarkan informasi dari para pinisepuh berasal dari Kraton Tembayat Klaten Jawa Tengah.\n<br/><br/>\nSuatu saat Ki Malang Yudho ngangklang bawono melihat perumahan para anak muridnya kearah Timur sampai di persil 17 d I beliau melihat api sebesar pohon kelapa seolah-olah seperti sampai setinggi langit, lantas beliau bersabda kalau ada ramainya jaman tempat ini dinamakan Genilangit\n<br/><br/>\nSelama bermasyarakat Ki Malang Yudho oleh anggota masyarakat dipercaya sebagai pemimpin desa tersebut, suatu ketika Ki Malang Yudho dengan di ikuti Cantriknya serta anggota masyarakat setempat sudah bermusyawarah berpikir karena pada lokasi yang ditempati tidak ada air, akhir rombongan tersebut berangkat menuju ke Lokasi Trojiwo tidak pernah ditinggalkannya yaitu sebuah teken selalu dibawa kemanapun pergi, disitulah Ki Malang Yudho memperlihatkan kesaktiannya yaitu sebuah teken yang tidak pernah lepas dari tangannya itu diseret yang akhirnya menjadi saluran yang dinamakan Saluran Trojiwo, sebelum airnya mengalir saluran tersebut pernah mengalir jendel/lintah melihat kesaktiannya Ki Malang Yudho dijadikan guru karena nasehatnya sangat mengandung arti yang cukup dalam tentang sejatining urip sangat dikenal orang yang lembah manah tapi tidak takut menghadapi bahaya apapun serta tanggung jawab penuh terhadap anak buahnya.\n<br/><br/>\nBeliau sangat tidak senang kepada anak muridnya yang mempunyai sifat takabur/sombong, dan juga tidak senang kepada orang yang mempunyai sifat warok, sampai keluar kata-kata barang siapa hidup di desa Genilangit memperlihatkan waroknya pasti tidak akan lama pendek kata tidak krasan akan minggat dari desa ini.\n<br/><br/>\nSambil duduk santai dengan dikerumuni oleh pengikutnya Ki Malang Yudho setiap pembicaraan yang keluar atau didengar selalu mengandung makna, pada saat itu para pengikutnya mendengar He bocah-bocah kabeh mbesuk sak pungkurku ono tlatah kene tak tinggali kunir sak krenjang motoero dan beliau berpesan : 1. Ki Malang Yudho beserta Cantriknya kalau kelak meninggal dunia minta disemayamkan di perbatasan desa Genilangit sebelah Timur, dengan maksud apabila ada mara bahaya dari Timur beliau yang akan menanggulangi. 2. Nyai Malang Yudho yang akrab disebut mbah Putih karena kulitnya putih dengan rambut yang keseluruhan juga putih berserta para dayang-dayangnya sejumlah 8 (delapan) orang, juga minta mohon kelak kalau sudah meninggal dunia mohon untuk disemayamkan di perbatasan desa Genilangit sebelah barat dengan maksud apabila ada mara bahaya dari Barat beliaulah yang akan menahan. 3. Setelah saya meninggal dunia orang yang memimpin kalian namakan LURAH pilihlah orang yang mampu dan mau serta mulat sariro hangroso wani.','http://localhost/storage/photos/shares/profile2.png','profile','-','2023-01-16 16:42:15','2023-01-16 16:42:15'),(10,'VIsi Content','TERWUJUDNYA MASYARAKAT DESA GENILANGIT SEJAHTERA YANG BERMARTABAT DAN MANDIRI ','http://localhost/storage/photos/shares/logo (1).png','visi&misi','-','2023-01-16 16:44:43','2023-01-16 16:44:43'),(11,'Misi Content','-','http://localhost/storage/photos/shares/logo (1).png','visi&misi','-','2023-01-16 16:45:09','2023-01-16 16:45:09'),(12,'struktur organigram','-','http://localhost/storage/photos/shares/Screenshot 2023-01-18 at 21.56.25.png','organigram','-','2023-01-18 14:56:51','2023-01-18 14:56:51'),(13,'Kantor Desa','-','http://localhost/storage/photos/shares/Screenshot 2023-01-18 at 22.08.13.png','kantor-desa',NULL,'2023-01-18 15:08:43','2023-01-18 15:08:43');
/*!40000 ALTER TABLE `content` ENABLE KEYS */;
UNLOCK TABLES;

