INSERT INTO `gallery` VALUES (1,'gallery1','Seluruh warga Dusun Wonomulyo, atas kehadiran Gubernur  Jawa timur Ibu Khofifah beserta Bupati Magetan Bapak Suprawoto dan seluruh rombongan. Wonomulyo sebuah Dusun yang terpencil dan berada di ujung Barat Provinsi Jawa Timur, ternyata sangat diperhatikan Beliau-Beliau. Sungguh kami sangat berterima kasih pada Ibu Gubernur, Bapak Bupati, dan seluruh rombongan yang hadir.','http://localhost/storage/photos/shares/Screenshot 2023-01-16 at 23.47.02.png','-','foto','2023-01-16 16:52:50','2023-01-16 16:52:50'),(2,'galery2','Tongkling Pringgowulung Wonomulyo<br/>\nTongkling merupakan musik tradisional ciri khas Dusun Wonomulyo yang sejarah terbentuknya karena terinspirasi dari kisah babat Ki Hajar Wonokoso di Dusun Wonomulyo.','http://localhost/storage/photos/shares/Screenshot 2023-01-16 at 23.47.15.png','-','foto','2023-01-16 16:54:14','2023-01-16 16:54:14');
